    <tr><td headers="field" class="gt_row gt_left" style="border-top-width: 1.5px; border-top-style: dotted; border-top-color: black;"><b><u>PPA_PERIOD</u></b>:<br><br>The 6-month period during which the payments are adjusted based on ETC Participants' performance in each Measurement Year.</td></tr>
